import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';


const App = () => {
    return (
        <div className="ui container commnents">
            <CommentDetail author="Sam" timeAgo="Today at 4:45pm" textComment="Pretty Cool Post!" />
            <CommentDetail author="Jane" timeAgo="Today at 2:30am" textComment="Awesome Post!" />
            <CommentDetail author="Mike" timeAgo="Yesterday at 1:30pm" textComment="Nice Post!" />
        </div>
    );
};

ReactDOM.render (<App />, document.querySelector('#root'));
